INSERT INTO `messages` (`id`, `user_id`, `message`, `created`) VALUES
(1, 1, 'Thermal comfort is created through the right combination of temperature, airflow and humidity. A combination of these elements is required for physical comfort in the workplace. When you hear people complaining about temperature in the workplace, chances are that airflow and humidity are part of the reason.', '2016-02-15 12:24:33'),
(2, 2, 'People generally prefer to be surrounded by nature, which provides endless sources of variation and sensory change. The instinctive bond between humans and other living systems, often called biophilia, is important to replicate in interior environments. It is also beneficial for people to spend time outside, even for limited time, during the day.', '2016-02-15 12:24:33'),
(3, 3, 'In much the same way that they prefer access to nature, views and daylight, people also prefer sensory change and variability. A lack of visual stimulation during the day can dull the senses and affect a workers ability to stay alert. Large expanses of neutral-colored workstations, all with the same height and texture, typically do not support human productivity.', '2016-02-15 12:25:26'),
(4, 4, 'How people perceive color varies based on their culture and life experiences. However, there are some generalizations about how color is likely to be perceived, either overtly or subliminally, in the workplace.', '2016-02-15 12:25:30'),
(5, 9, 'Hello everyone. How are you. Be dedicated in your responsibility! You will be awarded&nbsp;', '2016-02-18 13:36:03');
