(903, 'Shamim Mazumder', '917-701-4177', 'shamim.mazumder@gmail.com', 'Hi\r\n\r\nMy name is Shamim Mazumder, I have moved to Dallas, TX last year from NY. I have got to know about Total Cable from a friend who also moved to Dallas from Michigan. When I have started getting familiar with the community here, I have found out that there is a big demand of Bangla  channels with Hindi channels. There are big presence of other communities, such as Indian, Pakistani, Afgani, Arabs and many more. Me and my company are serving this community with various services, such as Networking, Internet Services, PBS Phone lines, Security Cameras and other need of Hardware - Software services.\r\n\r\nI see a big potential for Total Cable and big potential for marketing as well. Let us talk and find a mutual ground to explore this potential market here.\r\n\r\nLooking forward to hear from you soon.\r\n\r\nRegards\r\n\r\nShamim Mazumder', 'not checked', '2015-10-22 03:11:19', '2015-10-22 03:11:19'),
(904, 'Mahdi Choudhoury', '586-745-4441', 'matt@compexpro.com', 'We own a computer repair and retail center. We have many customers that want bangladeshi tv. We are looking for a partner that can help us with that.\r\n\r\n', 'not checked', '2015-11-03 03:34:40', '2015-11-03 03:34:40'),
